sys_variable_value.value:
(function execute(inputs, outputs) {

  var grCred = new GlideRecord('api_key_credentials');
  grCred.get('name','CSC Authorization Key');
  var encApiKey = grCred.api_key;
  // This will mask the variable and force it to be used as an ecrypted variable.
  outputs.authorization_token = sn_fd.GlideActionUtil.setEncryptedOutput(encApiKey);

})(inputs, outputs);

